// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MAPPING3 {

    struct student {
        //string name;
        uint number;
        uint score;
    }

    mapping( string => student) students;

    function setStudent(string memory _name, student memory _student) public {
        students[_name] = _student;
    }

}

